import React, { Component } from "react";
import axios from "axios";
import { Redirect } from 'react-router-dom'
import User from "./RegisterCandidate";

class MyComponent extends React.Component {
  state = {
    redirect: false
  }
  setRedirect = () => {
    this.setState({
      redirect: true
    })
  }
  renderRedirect = () => {
    if (this.state.redirect) {
      return <Redirect to='/components/RegisterCandidate' />
    }
  }
  render () {
    return (
       <div>
        {this.renderRedirect()}
        <button onClick={this.setRedirect}>Candidate Registration</button>
       </div>
    )
  }
}
